CREATE TABLE `gjk_compmanage` (
  `id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '主键',
  `project_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL,
  `comp_id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '构件id',
  `comp_name` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '构件名称',
  `comp_funcname` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '构件函数名',
  `comp_number` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '构件编号',
  `version` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '版本号',
  `user_id` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '提交人',
  `date_time` datetime DEFAULT NULL COMMENT '提交时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC;

/*Data for the table `gjk_compmanage` */

/*Table structure for table `gjk_component` */

DROP TABLE IF EXISTS `gjk_component`;

CREATE TABLE `gjk_component` (
  `id` varchar(64) COLLATE utf8mb4_bin NOT NULL,
  `comp_id` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '构件编号',
  `comp_name` varchar(255) COLLATE utf8mb4_bin NOT NULL COMMENT '构件名称',
  `comp_funcname` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '构件函数名',
  `user_id` varchar(64) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '用户',
  `version` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '版本',
  `comp_img` varchar(2000) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '构件图片',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `description` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '描述',
  `apply_state` varchar(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '审批状态',
  `apply_desc` varchar(255) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '审批描述',
  `del_flag` char(1) COLLATE utf8mb4_bin DEFAULT '0' COMMENT '0-正常，1-删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC COMMENT='构件表';

/*Data for the table `gjk_component` */

